-- товар
-- drop table `goods`;
create table `goods`(
id int primary key auto_increment,
num varchar(50), -- кассовый номер
catalog varchar(50), -- каталожный номер
mark varchar(100), -- маркировка
name varchar(255) not null, -- название
unit_id int, -- еденица измерения
 constraint fk_unitid_goods
   foreign key(unit_id)
    references  unit(id)
	on update cascade
	on delete cascade,

currency_id int,
 constraint fk_currencyid_goods
   foreign key(currency_id)
    references  currency(id)
     on update cascade
	 on delete cascade,

factory_id int, -- производитель
  constraint fk_factoryid_goods
   foreign key(factory_id)
    references factory(id)
        on update cascade
        on delete cascade,
 category_id int,   -- категория
  constraint fk_categoryid_goods
   foreign key(category_id)
    references category(id)
        on update cascade
        on delete cascade,
inprice varchar(25) default '0', -- входная цена
addition varchar(25) default '75', -- наценка в %
countprice boolean default true, -- вычисляемая цена
archive boolean default false, -- в архиве
metric_order int default 25, -- порядок в категории
outprice varchar(25) default '0', -- выходная цена
max_order int default 6, -- максимальное количество в заказе
path_image  varchar(255) default null -- путь к рисунку

)engine=innoDB;
-- заказ
create table `order`(
id int primary key auto_increment,  -- первичній ключ
create_date varchar(50) not null,  -- время создания
name varchar(255) default '',     -- имя 
fone varchar(255) not null,   -- телефон
done boolean default false,   -- отметка выполнении 
description text default ''  -- поясненмя
 -- countgoods int default 0,  -- количество товара (убрать)
-- totalorder varchar(255)   -- сумма товара
)engine=innoDB;

create table `goodsorder`(
id int primary key auto_increment,
quantity int,
order_id int,
constraint fk_orderid_goodsorder
    foreign key(order_id)
    references `order`(id)
        on update cascade
        on delete cascade,
goods_id int,
constraint fk_goodsid_goodsorder
    foreign key(goods_id)
    references `goods`(id)
        on update cascade
        on delete cascade
)engine=innoDB;

CREATE TABLE `bgoods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `curid` int(11) NOT NULL DEFAULT '0',
  `catid` int(11) NOT NULL DEFAULT '0',
  `prodid` int(11) NOT NULL DEFAULT '0',
  `groupid` int(11) NOT NULL DEFAULT '0',
  `uzelid` int(11) NOT NULL DEFAULT '0',
  `supplid` int(11) NOT NULL DEFAULT '0',
  `num` varchar(15) NOT NULL DEFAULT '',
  `katalog` varchar(30) NOT NULL DEFAULT '',
  `name` varchar(255) NOT NULL DEFAULT '',
  `unit` varchar(15) NOT NULL DEFAULT '',
  `mark` varchar(30) NOT NULL DEFAULT '',
  `pr` varchar(15) NOT NULL DEFAULT '',
  `price1` varchar(15) NOT NULL DEFAULT '',
  `price2` varchar(15) NOT NULL DEFAULT '',
  `price3` varchar(15) NOT NULL DEFAULT '',
  `price4` varchar(15) NOT NULL DEFAULT '',
  `maxres` smallint(5) unsigned NOT NULL DEFAULT '0',
  `mincount` smallint(5) unsigned NOT NULL DEFAULT '0',
  `maxcount` smallint(5) unsigned NOT NULL DEFAULT '0',
  `photo` varchar(100) NOT NULL DEFAULT '',
  `numcat` mediumint(8) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `catid` (`catid`),
  KEY `indprod` (`prodid`),
  KEY `indgr` (`groupid`),
  KEY `induzel` (`uzelid`),
  KEY `indsuppl` (`supplid`),
  KEY `indnum` (`num`),
  KEY `indname` (`name`),
  KEY `numcat` (`numcat`),
  KEY `indkatalog` (`katalog`),
  KEY `indmark` (`mark`)
)CHARSET=utf8;

